style.css:
@-moz-document domain("braintreegateway.com") {
#customer_credit_card_cvv_container {
    margin-top: -57px;
}

.content .transactions_new h2 {
    margin-bottom: 1em;
}

#customer_credit_card_options_verify_card_container {
    margin-top: -25px;
}

#customer_email_container {
    position: relative;
    z-index: 10;
}

#customer_form #payment_method_details {
    position: relative;
    top: -70px;
}

#customer_form .footer-nav {
    margin-top: -140px;
}

#customer_form .form-block {
    margin-top: -130px;
}

customer_form #customer_submit {
    position: relative;
    margin-top: 1em;
}

#customer_form h3, .radio-toggle, #payment_method_details .block #billing_address_fields, #customer_company_container, #customer_phone_container, #customer_fax_container, #customer_website_container, #customer_id_container, #customer_credit_card_token_container, #customer_last_name_container, #customer_first_name_container, #customer_credit_card_cardholder_name_container, #payment_method_details .bt-tooltip-container,  #transaction_merchant_account_id_container, #transaction_type_container, #transaction_voice_authorization_container, #transaction_tax_amount_container, .inform.help, #transaction_tax_exempt_container, #transaction_options_submit_for_settlement_container, #transaction_purchase_order_number_container, #transaction_customer_company_container, #transaction_customer_phone_container, #transaction_customer_fax_container, #transaction_customer_website_container, #transaction_options_submit_for_settlement_container, #transaction_credit_card_cardholder_name_container, #currency_iso_code, #customer_form .help, #customer_credit_card_options_verification_merchant_account_id_container {
    display: none !important;
}

#transaction_amount_container {
    background-color: #fff;
    margin-bottom: -60px;
    position: relative;
    z-index: 10;
}

#transaction_credit_card_number_container, #transaction_credit_card_expiration_date_container {
    margin-top: -20px;
}

#transaction_form .block:nth-child(1), #transaction_form .block:nth-child(3), #transaction_form .block:nth-child(5) {
    display: none;
}

#transaction_form .block:nth-child(2), #transaction_form .block:nth-child(4) {
    display: block;
}

#transaction_order_id_container {
    margin-top: -30px;
}

.customers_new .header_group {
    margin-bottom: 90px;
}

.new_customer_payment_method #credit_card_token_container, .new_customer_payment_method #credit_card_options_make_default_container, .new_customer_payment_method #credit_card_options_verification_merchant_account_id_container, .new_customer_payment_method h3, .new_customer_payment_method #billing_address_fields {
    display: none;
}

.transactions_new .block, .transactions_new h3 {
    display: none;
}

.transactions_new ul.form-block {
    margin: -90px 0 0;
}
}
